description:
The turkeys revolted three years ago. Not coincidentally, that was the same year mankind last had Thanksgiving dinner.We should have seen it coming. It was the logical conclusion of our perennial turkey oppression. Years of slicing, dicing, chopping, and carving in the name of tastiness. Gobble-gobble, indeed.
Even as the revolution flared, we thought it would be easy. We thought they were dim-witted, clumsy, unworthy adversaries. We thought they would soon be on our Thanksgiving dinner table again. We thought wrong. They had outside help. Intergalactic turkeys flocked to the aid of their earthly brethren. They were intelligent, organized, technologically advanced. And they were merciless.
It's now time for you to fight for our ancestral right to turkey roast. Will you triumph over the foul fowls? Will mankind ever have Thanksgiving dinner again? Or will you end up as part of the menu in a galactic turkey restaurant?

